import React, {useState, useEffect} from "react";
import axios from 'axios'
import QualityCreate from "./QualityCreate"
import QualityList from "./QualityList"

const InventoryResult = () =>{
    const [results, setResults] = useState({});
    
    const fetchResults = async () => {
        const res = await axios.get('hhtp://localhost:4000/parts')

        setResults(res.data)
    };
    useEffect(() => {
        fetchResults();
    }, [])

    // console.log(results)

    const renderedPosts = Object.values(results).map((result) => {
        return (
          <div
            className="card"
            style={{ width: "30%", marginBottom: "20px" }}
            key={result.id}
          >
            <div className="card-body">
              <h3>{result.title}</h3>
              <QualityList comments={result.comments} />
              <QualityCreate resultId={result.id} />
            </div>
          </div>
        );
      });
      return (
        <div className="d-flex flex-row flex-wrap justify-content-between">
          {renderedPosts}
        </div>
      );
    };

export default InventoryResult;
